declare namespace java {
    namespace net {
        /**
         * Represents a family of communication protocols.
         * @since 1.7
         */
        // @ts-ignore
        interface ProtocolFamily {
            /**
             * Returns the name of the protocol family.
             * @return the name of the protocol family
             */
            // @ts-ignore
            name(): java.lang.String
        }
    }
}
